webpackJsonp([0xa66b96fba949],{474:function(e,t){e.exports={pathContext:{group:[{node:{fields:{slug:"/48-the-majesty-of-vuejs2-and-road-to-learn-react/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/502474455&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Есть две книги: Величие Vue.js 2 (The Majesty of Vue.js 2) и Путь к изучению React (The Road to learn React) - какую сам прочитаешь, а какую другу посоветуешь? Сделаю небольшой обзор.</p>\n<ul>\n<li><a href="https://leanpub.com/vuejs2-russian">https://leanpub.com/vuejs2-russian</a> - Величие Vue.js 2</li>\n<li><a href="https://leanpub.com/the-road-to-learn-react-russian">https://leanpub.com/the-road-to-learn-react-russian</a> - Путь к изучению React</li>\n<li><a href="https://github.com/lex111">https://github.com/lex111</a> - Алексей Пыльцын</li>\n<li><a href="https://medium.com/devschacht">https://medium.com/devschacht</a> - блог с переводами статей про веб-разработку</li>\n<li><a href="https://github.com/web-standards-ru/dictionary">https://github.com/web-standards-ru/dictionary</a> - словарь Веб-стандартов</li>\n<li><a href="https://ru.react.js.org/">https://ru.react.js.org/</a> - сайт с переводом официальной документации к React на русский</li>\n<li><a href="https://github.com/js-ru/react-ru">https://github.com/js-ru/react-ru</a> - репозиторий с переводом официальной документации к React на русский</li>\n</ul>',excerpt:"Есть две книги: Величие Vue.js 2 (The Majesty of Vue.js 2) и Путь к изучению React (The Road to learn React) - какую сам прочитаешь, а какую…",frontmatter:{title:"#48 - Величие Vue.js 2 и Путь к изучению React - обзор книг",date:"September 20, 2018",featuredImage:null}}},{node:{fields:{slug:"/47-elm-019/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/497163783%3Fsecret_token%3Ds-YVNxe&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Обсудили вместе с Алексеем Пироговым (<a href="https://twitter.com/alex_pir">https://twitter.com/alex_pir</a>) новую версию, тенденции в развитии языка, его недостатки и нишу в веб-разработке, бегло сравнили с другими ФП языками в вебе. Отдельно поговорили про Reason, Go, ООП, Go2 и generics, вероятность появления Elm2.</p>\n<ul>\n<li><a href="https://elm-lang.org/">https://elm-lang.org/</a></li>\n<li><a href="https://t.me/brain_dump_etc">https://t.me/brain<em>dump</em>etc</a> - Telegram канал Алексея</li>\n<li><a href="https://devzen.ru/episode-0194/">https://devzen.ru/episode-0194/</a> - Алексей в подкасте DevZen</li>\n</ul>',excerpt:"Обсудили вместе с Алексеем Пироговым ( https://twitter.com/alex_pir ) новую версию, тенденции в развитии языка, его недостатки и нишу в веб…",frontmatter:{title:"#47 - Elm 0.19",date:"September 13, 2018",featuredImage:null}}},{node:{fields:{slug:"/46-juliarderity-by-chicoxyzzy/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/495406275%3Fsecret_token%3Ds-ax86W&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сергей Рубанов, известный в широких фронтенд кругах Панк-разработчик из города Орла, член команды Babel и участник WebAssembly Community Group в начале августа запустил телеграм канал Хулиардерити.</p>\n<p>Пишет в осоновном хардкорные новости из недр комитета TC39, из кишков Babel и всего такого, что в обычных пабликах и хабрах не публикуют, т.к. слишком гиково. А нам такое как раз интересно!</p>\n<ul>\n<li><a href="https://t.me/juliarderity">https://t.me/juliarderity</a></li>\n<li><a href="https://twitter.com/chicoxyzzy">https://twitter.com/chicoxyzzy</a></li>\n</ul>',excerpt:"Сергей Рубанов, известный в широких фронтенд кругах Панк-разработчик из города Орла, член команды Babel и участник WebAssembly Community…",frontmatter:{title:"#46 - Juliarderity by Chicoxyzzy - хардкорные новости о JavaScript в Telegram",date:"September 6, 2018",featuredImage:null}}},{node:{fields:{slug:"/45-simple-podcast-recording-made-easy/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/491699670%3Fsecret_token%3Ds-O97yO&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Как записать подкаст без особого подкастерского микрофона и специального оборудования? Делай как я!</p>\n<ul>\n<li><a href="https://www.audacityteam.org/download/">https://www.audacityteam.org/download/</a></li>\n<li><a href="https://manual.audacityteam.org/man/faq_installation_and_plug_ins.html#lame">https://manual.audacityteam.org/man/faq<em>installation</em>and<em>plug</em>ins.html#lame</a></li>\n<li><a href="https://soundcloud.com">https://soundcloud.com</a></li>\n<li><a href="https://podster.fm">https://podster.fm</a></li>\n<li><a href="https://itunesconnect.apple.com">https://itunesconnect.apple.com</a></li>\n<li><a href="https://github.com/AveVlad/russia-it-podcast">https://github.com/AveVlad/russia-it-podcast</a></li>\n</ul>\n<p>Упомянутые в подкасте эффекты и их настройки:\n<strong>Effects -> Noise Reduction</strong>\nNoise Reduction: 12 dB\nSensetivity: 6\nFrequency smoothing: 3\nNoice: Reduce</p>\n<p><strong>Effects -> Truncate Silence</strong>\nDetect Silence:\nLevel: -20 dB\nDuration: 1 sec\nAction: Truncate Detected Silence\nTruncate to: 1 sec\nTruncate tracks independently: No</p>\n<p><strong>Effects -> Compressor</strong>\nThrashold: -26 dB\nNoice Floor: -55 dB\nRatio: 5.7:1\nAttack time: 0.5 sec\nRelease time: 1 sec\nMake-up gain for 0 dB after compressing: Yes\nCompress based on Peaks: Yes</p>',excerpt:"Как записать подкаст без особого подкастерского микрофона и специального оборудования? Делай как я! https://www.audacityteam.org/download…",frontmatter:{title:"#45 - Как записать подкаст без микрофона и оборудования",date:"August 30, 2018",featuredImage:null}}},{node:{fields:{slug:"/44-middle-developer-day/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/490131510&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Подкаст-интервью с гостем в студии, о технологиях и путях саморазвития из жизни middle работчика.</p>',excerpt:"Подкаст-интервью с гостем в студии, о технологиях и путях саморазвития из жизни middle работчика.",frontmatter:{title:"#44 - Из жизни одного middle разработчика",date:"August 24, 2018",featuredImage:null}}}],pathPrefix:"",first:!1,last:!1,index:3,pageCount:12,additionalContext:{}}}}});
